## Description
On October 12, 2020, HP Enterprise (HPE) published a [security bulletin](https://support.hpe.com/hpesc/public/docDisplay?docLocale=en_US&docId=emr_na-hpesbnw04036en_us) disclosing 64 separate remote code execution (RCE) and unauthorized data injection vulnerabilities in its Intelligent Management Center (IMC) product.

As of October 21, 2020, Rapid7 researchers have independently verified that 12 of the vulnerabilities were fixed in HPE IMC 7.3 patch E0705P02, which was [released on December 6, 2019](https://h10145.www1.hpe.com/Downloads/SoftwareReleases.aspx?ProductNumber=JG747AAE&lang=en&cc=us&prodSeriesId=4176535). The other 52 vulnerabilities appear to have been fixed in HPE IMC 7.3 patch E0705P07, which was released on October 12, 2020 along with the advisory that prompted this analysis. The cumulative advisory from HPE may have been published for the sake of mapping previously unpublished CVEs to several batches of vulnerabilities disclosed by the [Zero Day Initiative (ZDI)](https://www.zerodayinitiative.com/) in early 2020. We are not aware of any active exploitation as of October 28, 2020.

The CVEs included in the advisory are:
* CVE-2020-7141 through CVE-2020-7195
* CVE-2020-24629
* CVE-2020-24630
* CVE-2020-24646 through CVE-2020-24652

41 of the CVEs carry a 9.8 CVSSv3 base score, while the other 23 carry an 8.8 base score.

By cross-referencing the vulnerabilities in the advisory with ZDI's [published advisories](https://www.zerodayinitiative.com/advisories/published/), Rapid7 researchers determined that CVE-2020-7141 through CVE-2020-7143, CVE-2020-24629, CVE-2020-24630, and CVE-2020-24646 through CVE-2020-24652 were patched in HPE IMC version 7.3 (E0705P02), while CVE-2020-7144 through CVE-2020-7195 were presumably patched in 7.3 (E0705P07).

## Affected products
We have included a full table of affected products and patch versions at the bottom of this analysis.
* HPE Intelligent Management Center (IMC) prior to 7.3 **(E0705P02)**
  - CVE-2020-7141 through CVE-2020-7143
  - CVE-2020-24629
  - CVE-2020-24630
  - CVE-2020-24646 through CVE-2020-24652
* HPE Intelligent Management Center (IMC) prior to 7.3 **(E0705P07)**
  - CVE-2020-7144 through CVE-2020-7195

## Rapid7 analysis
HPE IMC is a well-known enterprise product whose user base presents high-value opportunities for attackers. The vast majority of the vulnerabilities in HPE's cumulative advisory have been publicly [available on ZDI's 2020 advisories page](https://www.zerodayinitiative.com/advisories/published/) (with technical detail) since January and February of 2020, which means that attackers have had the information they need to craft and hone attacks for the better part of a year. It's likely that we'll see more HPE IMC vulnerability disclosures through at least the beginning of 2021.

To test the E0705P02 patch hypothesis, Rapid7 researchers sampled [CVE-2020-24648](https://nvd.nist.gov/vuln/detail/CVE-2020-24648), a [Java deserialization vulnerability](https://www.zerodayinitiative.com/advisories/ZDI-19-1036/) in `AccessMgrServlet`. The sole Java deserialization vulnerability was chosen for the frequently and often easily exploitable nature of its bug class.

Contrary to HPE's security bulletin, the vulnerability did require authentication to exploit, prior to the E0705P02 patch. However, Rapid7 researchers surmise that [CVE-2020-24629](https://nvd.nist.gov/vuln/detail/CVE-2020-24629), an [authentication bypass](https://www.zerodayinitiative.com/advisories/ZDI-19-1038/) in `UrlAccessController`, could possibly be leveraged to bypass [CVE-2020-24648](https://nvd.nist.gov/vuln/detail/CVE-2020-24648)'s authentication requirement.

