The patch adds two new cases to the existing [path traversal](https://owasp.org/www-community/attacks/Path_Traversal) protection: `.%2e` and `%2e.`, both partially encoded forms of `..`, which is used to reference the parent directory in a path traversal attack.

Rapid7 vulnerability research teams believe that this patching methodology may see further bypasses in the future. Developers should take measures to adequately sanitize user input beyond a case-by-case basis.

## Guidance
Rapid7 recommends that HPE IMC customers apply the [latest patch](https://h10145.www1.hpe.com/Downloads/SoftwareReleases.aspx?ProductNumber=JG747AAE&lang=en&cc=us&prodSeriesId=4176535) (50-node product referenced), which is E0705P07 at the time of this writing. This will ensure that they are protected against all known vulnerabilities to date, not only the ones patched in E0705P02.

